import React from "react";
import Article from "./Article";
import { Paper, Grid, Card } from "@material-ui/core";
export default ({ news }) => {
  return (
    <Grid>
      <Card>
        {news.map(news => (
          <Article news={news} />
        ))}
      </Card>
    </Grid>
  );
};
